import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Modal, Button } from 'react-bootstrap'; // Import Bootstrap modal components
import LoginModal from './LoginModal';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS

const Navbar = () => {
  const [showLoginModal, setShowLoginModal] = useState(false);

  const handleShowLoginModal = () => {
    setShowLoginModal(true);
  };

  const handleCloseLoginModal = () => {
    setShowLoginModal(false);
  };

  return (
    <nav>
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <div class="collapse navbar-collapse" id="navbarSupportedContent">
          <ul class="navbar-nav mr-auto">
            <li class="nav-item active">
              <a class="nav-link" href="/sellerlogin" onClick={handleShowLoginModal}>
                Login as Seller
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="/buyerlogin" onClick={handleShowLoginModal}>
                Login as Buyer
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="/aggregatorlogin" onClick={handleShowLoginModal}>
                Login as Aggregator
              </a>
            </li>
          </ul>
        </div>
      </nav>

      {/* Render the LoginModal component */}
      <LoginModal show={showLoginModal} onHide={handleCloseLoginModal} />
    </nav>
  );
};

export default Navbar;
